-Set example for quality of work, amount of work, and mindset during my day.
-Provide assitance and on going training to new hires and other anaylsts. 
-Build on-going trainings, classes, and documentation. 
-Was awarded the Presence award and Retail Case Closure award for 2017.</p>
        <h2>Social Media</h2>
        <p>images</p>
 
        <p>Duis a turpis sed lacus dapibus elementum sed eu lectus.</p>
      </div>
    );
  }
}
 
export default About;
